import './App.css';

function App() {

  return (
    <div>
      <header className="header">
        <h1>Brutus A/S</h1>
      </header>
      <div className="inputForm">
        <form>
          <label>
              Name:
              <br/><input type="text" name="name" />
          </label>
          <input type="submit" value="Submit" />
        </form>
      </div>
    </div>
  );
}

export default App;
